import React from "react";

import Buttons from "./Buttons/Buttons";

class Homepage extends React.Component{
    render(props){
        return(
            <div>
                <h1>miTinerary</h1>
                <br/>
                <h3>Travel Off the Beaten Path</h3>
                <Buttons setAlgo={this.props.setAlgo}/>
            </div>
        )
    }
}

export default Homepage
